import React from 'react'
import { ThemeProvider } from 'emotion-theming'
import theme from '@rebass/preset'

const BoxTheme = () => {
  return (
    <Box>
      <Box style={{
        width: 256
      }} />
    </Box>
  );
};

export default BoxTheme;


